import React from "react";
import NavigationBarLink from "../navigation-link/navigationBarLink";

class NavigationBar extends React.Component {
    constructor() {
      super();
      this.state = {
        navigationLinks: [
          {
            title: 'Moteriški',
            categories: [
              {
                title: '',
              }
            ]
          },
          {
            title: 'Vyriški',
            categories: [
              {
                title: '',
              }
            ]
          },
          {
            title: 'Apie mus',
            link: ''
          }
        ],
      }
    }

    render() {
      const navigationBarLinks = this.state.navigationLinks.map(({ title, link, categories }, i) => (
        <NavigationBarLink
          key={i}
          title={title}
          link={link}
          categories={categories}
        />
      ))
      return (
        <nav className="navigation-bar">
          <div className="container">
            {navigationBarLinks}
          </div>
        </nav>
      )
    }
  }

  export default NavigationBar;
